@Component({
  selector: 'group-box',
  templateUrl: 'groupbox.component.html',
  styleUrls: ['./groupbox.component.css']
})

export class GroupBoxComponent implements OnInit {
  @Input() title: String = '';

  constructor() { }

  ngOnInit() { }
}
<div class="groupBox">
  <div class="groupBoxTitle">{{title}}</div>
  <div class="groupBoxContent">
    <ng-content></ng-content>
  </div>
</div>
